axios.defaults.withCredentials = true;

const Welcome = () => {
  const sendRequest = async () => {
    try {
      const res = await axios.get('http://localhost:5050/api/user', {
        withCredentials: true,
      });
      const data = await res.data;
      return data
    } catch (err) {
      console.error(err);
    }
  };


  useEffect(()=>{
     sendRequest().then((data)=>setUser(data.user))
  },[])
